    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal align=center style='text-align:center'><b><span
    lang=ES-SV style='font-size:14.0pt;line-height:105%;font-family:"Bodoni MT Black",serif;
    mso-bidi-font-family:Arial'>¿CUÁNTOS INMIGRANTES ILEGALES HAY?<o:p></o:p></span></b></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>Por
    primera vez en décadas, el número de inmigrantes ilegales que viven en los Estados
    Unidos ha disminuido. En 2009, había cerca de un millón menos de
    inmigrantes ilegales en los Estados Unidos que en el 2007. Este descenso es
    aún más notable porque sucedió luego de un periodo de aumentos dramáticos.
    De 1990 a 2007, el número de inmigrantes ilegales aumentó en un promedio de
    500,000 al año, y la población aumentó de pocos millones a cerca de 12
    millones.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:10.0pt;line-height:105%;

    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal align=center style='text-align:center'><b><span
    lang=ES-SV style='font-size:12.0pt;line-height:105%;font-family:"Bodoni MT Black",serif;
    mso-bidi-font-family:Arial'>¿DE DÓNDE VIENEN Y DÓNDE SE ESTABLECEN?</span></b><span
    style='font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'><o:p>&nbsp;</o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span style='font-size:14.0pt;
    line-height:105%;font-family:"Arial",sans-serif;mso-ansi-language:ES-MX'>California
    tiene más inmigrantes ilegales provenientes de México. Tiene más
    inmigrantes ilegales en total que cualquier otro estado se calcula que unos
    2.6 millones. Pero California ya no es el destino que alguna vez fue. En la
    década de 1980, casi la mitad de los inmigrantes ilegales del país vivían
    en California; hoy en día la proporción del estado es de menos de la cuarta
    parte.<o:p></o:p></span></p>

  <td colspan=3 rowspan=3 align=left valign=top><img width=469 height=660
  src="Index_archivos/image012.png"
  alt="Cuadro de texto: LA INMIGRACIÓN ILEGAL&#13;&#10;&#13;&#10;A pesar de un descenso reciente, la cifra de inmigrantes ilegales en los Estados Unidos continua alta, y la inmigración ilegal sigue siendo uno de temas que más dividen al país. Los inmigrantes ilegales representan cerca del 28 por ciento de todos los residentes en los Estados Unidos nacidos en el extranjero.&#13;&#10; &#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;"

  <td colspan=2></td>
  <td></td>
  <td rowspan=3 align=left valign=top><img width=501 height=660
  src="Index_archivos/image013.png"
  alt="Cuadro de texto: ¿CUÁNTOS INMIGRANTES ILEGALES HAY?&#13;&#10;&#13;&#10;Por primera vez en décadas, el número de inmigrantes ilegales que viven en los Estados Unidos ha disminuido. En 2009, había cerca de un millón menos de inmigrantes ilegales en los Estados Unidos que en el 2007. Este descenso es aún más notable porque sucedió luego de un periodo de aumentos dramáticos. De 1990 a 2007, el número de inmigrantes ilegales aumentó en un promedio de 500,000 al año, y la población aumentó de pocos millones a cerca de 12 millones.&#13;&#10; &#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;"
  v:shapes="Rectángulo_x0020_3"></td>

  <td colspan=3 rowspan=3 align=left valign=top><img width=492 height=660
  src="Index_archivos/image014.png"
  alt="Cuadro de texto: ¿DE DÓNDE VIENEN Y DÓNDE SE ESTABLECEN?&#13;&#10;&#13;&#10;California tiene más inmigrantes ilegales provenientes de México. Tiene más inmigrantes ilegales en total que cualquier otro estado se calcula que unos 2.6 millones. Pero California ya no es el destino que alguna vez fue. En la década de 1980, casi la mitad de los inmigrantes ilegales del país vivían en California; hoy en día la proporción del estado es de menos de la cuarta parte.&#13;&#10;  &#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;&#13;&#10;"
